interface Advisor {
    advisor_id: number;
    name: string;
    affiliation: string;
    website: string;
    twitter: string;
    github: string;
    email: string;
    position: string;
    connections: {
      advisor_id: number;

      relation: Array<{
        class: string;
        role: string;
        duration: {
          start: number;
          end: number;
        };
      }>;
      collaborations: Array<{
        papername: string;
        year: number;
        url: string;
      }>;
      latestCollaboration: number;
      relationFactor: number;
    }[];
  }
